import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M10.5 2.5a.5.5 0 00-1 0v6a.5.5 0 001 0v-6z", fill: primaryFill }),
        React.createElement("path", { d: "M13.74 4a.5.5 0 10-.5.87 6.5 6.5 0 11-6.49 0 .5.5 0 10-.5-.87 7.5 7.5 0 107.5 0z", fill: primaryFill }));
};
const Power20Regular = wrapIcon(rawSvg({}), 'Power20Regular');
export default Power20Regular;
